import Header from "./components/Layout/Header";
import MusicList from "./components/Music/MusicList";

function App() {
  const musicList = [
    {
      id: "1",
      title: "unravel",
      album: "album_1",
      author: "author_1",
    },
    {
      id: "2",
      title: "title_2",
      album: "album_2",
      author: "author_2",
    },
  ];

  fetch("https://theaudiodb.p.rapidapi.com/playlist.php?s=Top_Popular_Tracks_2019", {
	"method": "GET",
	"headers": {
		"x-rapidapi-key": "afc7c5ac22mshea40c7eb8bdd14fp1c7715jsn48105b87b3fe",
		"x-rapidapi-host": "theaudiodb.p.rapidapi.com"
	}
})
.then(response => {
	console.log(response);
})
.catch(err => {
	console.error(err);
});

  return (
    <div>
      <section>
        <Header />
      </section>
      <section>
        <MusicList music={musicList} />
      </section>
    </div>
  );
}

export default App;
